import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { FaSearch, FaFilter } from 'react-icons/fa';

const MOCK_FISH = [
  {
    id: '1',
    name: 'Truite fario',
    scientificName: 'Salmo trutta',
    category: 'Eau douce',
    description: 'La truite fario est un poisson noble recherché pour sa combativité et sa méfiance.',
    imageUrl: 'https://cdn.pixabay.com/photo/2017/08/23/13/03/brown-trout-2672317_1280.jpg',
    habitat: 'Rivières fraîches et oxygénées',
    averageSize: { min: 20, max: 50, unit: 'cm' },
    averageWeight: { min: 0.2, max: 2, unit: 'kg' }
  },
  {
    id: '2',
    name: 'Brochet',
    scientificName: 'Esox lucius',
    category: 'Eau douce',
    description: 'Le brochet est le grand prédateur de nos eaux douces, réputé pour sa voracité.',
    imageUrl: 'https://cdn.pixabay.com/photo/2017/10/25/16/54/pike-2888246_1280.jpg',
    habitat: 'Lacs, étangs et rivières',
    averageSize: { min: 50, max: 130, unit: 'cm' },
    averageWeight: { min: 1, max: 15, unit: 'kg' }
  },
  {
    id: '3',
    name: 'Bar',
    scientificName: 'Dicentrarchus labrax',
    category: 'Eau de mer',
    description: 'Le bar est un poisson marin très prisé pour sa chair et sa combativité.',
    imageUrl: 'https://cdn.pixabay.com/photo/2016/04/13/07/18/bass-1326143_1280.jpg',
    habitat: 'Côtes rocheuses et plages',
    averageSize: { min: 30, max: 80, unit: 'cm' },
    averageWeight: { min: 0.5, max: 6, unit: 'kg' }
  }
];

const FishGuide = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCategory, setSelectedCategory] = useState('');
  const [isFilterOpen, setIsFilterOpen] = useState(false);

  const filteredFish = MOCK_FISH.filter(fish => {
    const matchesSearch = fish.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         fish.description.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesCategory = !selectedCategory || fish.category === selectedCategory;
    return matchesSearch && matchesCategory;
  });

  const categories = [...new Set(MOCK_FISH.map(fish => fish.category))];

  return (
    <div className="max-w-6xl mx-auto px-4 py-8">
      <div className="flex flex-col md:flex-row justify-between items-center mb-8">
        <h1 className="text-3xl font-bold text-nature-blue mb-4 md:mb-0">Guide des Poissons</h1>

        <div className="flex items-center space-x-4 w-full md:w-auto">
          <div className="relative flex-grow md:flex-grow-0">
            <input
              type="text"
              placeholder="Rechercher un poisson..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="w-full px-4 py-2 rounded-lg border focus:outline-none focus:border-nature-blue"
            />
            <FaSearch className="absolute right-3 top-3 text-gray-400" />
          </div>

          <button
            onClick={() => setIsFilterOpen(!isFilterOpen)}
            className="flex items-center space-x-2 px-4 py-2 bg-nature-blue text-white rounded-lg hover:bg-nature-blue-dark"
          >
            <FaFilter />
            <span>Filtrer</span>
          </button>
        </div>
      </div>

      {isFilterOpen && (
        <div className="mb-8 p-4 bg-gray-50 rounded-lg">
          <h2 className="font-semibold mb-4">Filtrer par catégorie</h2>
          <div className="flex flex-wrap gap-2">
            <button
              onClick={() => setSelectedCategory('')}
              className={`px-3 py-1 rounded-full ${
                selectedCategory === '' 
                  ? 'bg-nature-blue text-white' 
                  : 'bg-gray-200 text-gray-700 hover:bg-gray-300'
              }`}
            >
              Tous
            </button>
            {categories.map(category => (
              <button
                key={category}
                onClick={() => setSelectedCategory(category)}
                className={`px-3 py-1 rounded-full ${
                  selectedCategory === category 
                    ? 'bg-nature-blue text-white' 
                    : 'bg-gray-200 text-gray-700 hover:bg-gray-300'
                }`}
              >
                {category}
              </button>
            ))}
          </div>
        </div>
      )}

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredFish.map(fish => (
          <Link
            to={`/fish-guide/${fish.id}`}
            key={fish.id}
            className="bg-white rounded-lg shadow-lg overflow-hidden transform transition duration-200 hover:scale-105"
          >
            <div className="relative h-48">
              <img
                src={fish.imageUrl}
                alt={fish.name}
                className="w-full h-full object-cover"
              />
              <div className="absolute top-2 right-2">
                <span className="px-2 py-1 bg-white bg-opacity-90 rounded-full text-sm">
                  {fish.category}
                </span>
              </div>
            </div>
            <div className="p-4">
              <h2 className="text-xl font-bold text-nature-blue mb-2">{fish.name}</h2>
              <p className="text-gray-600 line-clamp-2">{fish.description}</p>
              <div className="mt-4 flex justify-end">
                <span className="text-nature-blue hover:underline">Plus d'informations →</span>
              </div>
            </div>
          </Link>
        ))}
      </div>

      {filteredFish.length === 0 && (
        <div className="text-center py-12">
          <p className="text-gray-600">Aucun poisson ne correspond à votre recherche.</p>
        </div>
      )}
    </div>
  );
};

export default FishGuide;
